import React from "react";
import "./App.css";
import Loginimg from "./componetc/Loginimg";
import { Route, Routes } from "react-router-dom";
// import Log from "./componetc/Log";
import Dashbord from './componetc/';
// import Dashbord from "./componetc/ashbord/Dashbord";

function App() {
  return (
    <>
      <switch>
        <Routes>
          <Route path="/" Component={<Loginimg />} />
        </Routes>
        <Routes>
          <Route path="/dashbord" Component={<Dashbord />} />
        </Routes>
      </switch>

      {/* <Loginimg /> */}
      {/* <Dashbord/> */}
      {/* <Log/> */}
    </>
  );
}

export default App;
